import React, { PureComponent } from 'react';
export default class Home extends PureComponent {
    render() {
        return (
            <div style={{ display: 'flex', width: '100%', justifyContent: 'center', alignItems: 'center' }}>
                <div style={{width: '80%', border: '1px solid red', background: "url(" + require("./src/nomatch.jpg") + ") no-repeat 0 0",backgroundSize: 'cover' }}>
                    <div style={{width: '80%',margin:'20%',border:'1px solid red'}}></div>
                </div>
            </div>
        )
    }
}
